import Signup from "./Component/Signup";
import "./App.css";
import { Route, Routes } from "react-router-dom";
import Login from "./Component/Login";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Signup />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/Signup" element={<Login />} />

      </Routes>
    </div>
  );
}

export default App;
